import React from "react";
import {apiCall} from './utils/apiCall'
import { useNavigate } from "react-router-dom";

function Register() {

    const navigate = useNavigate();

    function addUser(e){
        let data = {userName: e.target[0].value, fullName: e.target[1].value, email: e.target[2].value}
        apiCall('/user', 'post', data).then(res=>{
            navigate('/')
        })
    }
    
    return (
        <div className="container">
            <div className="card col-6 mt-5">
                <form onSubmit={addUser} action="">
                    <div className="card-header">
                        <h5 className="text-center">Login</h5>
                    </div>
                    <div className="card-body">
                        <input type="text" placeholder="Firstname..." className="form-control my-2" />
                        <input type="text" placeholder="Lastname..." className="form-control my-2" />
                        <input type="text" placeholder="Email..." className="form-control my-2" />
                    </div>
                    <div className="card-footer">
                        <a href="http://localhost:3000/">Have you got an account?</a>
                        <button className="btn btn-warning w-100 my-2">Submit</button>
                    </div>
                </form>
            </div>
        </div>
    )
}

export default Register;
